serif; vertical-align: baseline; color: rgb(0, 0, 0);">SL Pres. XI&nbsp;<span class="bold" style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: BentonSansBold, Arial, sans-serif; vertical-align: baseline;">187</span></div><div class="innings-info-2" style="box-sizing: inherit; margin: 0px; padding: 0px 0px 3px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 17px; line-height: 30px; font-family: BentonSans, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0);">Indians&nbsp;<span class="bold" style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: BentonSansBold, Arial, sans-serif; vertical-align: baseline;">246/5 (54 ov)</span></div><div class="match-status" style="box-sizing: inherit; margin: 0px; padding: 3px 0px 7px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 12px; line-height: inherit; font-family: BentonSans, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0);"><span class="bold" style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: BentonSansBold, Arial, sans-serif; vertical-align: baseline;">Lunch - Indians lead by 59 runs with 5 wickets remaining in the 1st innings</span></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 2),
