(6, 6, 'Cricket Match India Vs Pakisthan', '2017-07-27', '11:30:00', ' Melbourne Cricket Ground in Melbourne, Victoria, Australia', '', '', '<p style="margin-top: 0.5em; margin-bottom: 0.5em; line-height: inherit; color: rgb(34, 34, 34); font-family: sans-serif;"><b>Cricket</b>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Bat-and-ball_games" title="Bat-and-ball games" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">bat-and-ball game</a>&nbsp;played between two teams of eleven players each on a&nbsp;<a href="https://en.wikipedia.org/wiki/Cricket_field" title="Cricket field" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">cricket field</a>, at the centre of which is a rectangular 22-yard-long&nbsp;<a href="https://en.wikipedia.org/wiki/Cricket_pitch" title="Cricket pitch" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">pitch</a>&nbsp;with a target called the&nbsp;<a href="https://en.wikipedia.org/wiki/Wicket" title="Wicket" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">wicket</a>&nbsp;(a set of three wooden&nbsp;<a href="https://en.wikipedia.org/wiki/Stump_(cricket)" title="Stump (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">stumps</a>&nbsp;topped by two&nbsp;<a href="https://en.wikipedia.org/wiki/Bail_(cricket)" title="Bail (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">bails</a>) at each end. Each phase of play is called an&nbsp;<a href="https://en.wikipedia.org/wiki/Innings" title="Innings" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">innings</a>&nbsp;during which one team&nbsp;<a href="https://en.wikipedia.org/wiki/Batting_(cricket)" title="Batting (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">bats</a>, attempting to score as many&nbsp;<a href="https://en.wikipedia.org/wiki/Run_(cricket)" title="Run (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">runs</a>&nbsp;as possible, whilst their opponents&nbsp;<a href="https://en.wikipedia.org/wiki/Fielding_(cricket)" title="Fielding (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">field</a>. Depending on the type of match, the teams have one or two innings apiece and, when the first innings ends, the teams swap roles for the next innings. Except in matches which result in a&nbsp;<a href="https://en.wikipedia.org/wiki/Result_(cricket)#Draw" title="Result (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">draw</a>, the winning team is the one that&nbsp;<a href="https://en.wikipedia.org/wiki/Scoring_(cricket)" title="Scoring (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">scores</a>&nbsp;the most runs, including any&nbsp;<a href="https://en.wikipedia.org/wiki/Extra_(cricket)" title="Extra (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">extras</a>&nbsp;gained.</p><p style="margin-top: 0.5em; margin-bottom: 0.5em; line-height: inherit; color: rgb(34, 34, 34); font-family: sans-serif;">Before a match begins, the two team&nbsp;<a href="https://en.wikipedia.org/wiki/Captain_(cricket)" title="Captain (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">captains</a>&nbsp;meet on the pitch for the&nbsp;<a href="https://en.wikipedia.org/wiki/Toss_(cricket)" title="Toss (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">toss</a>&nbsp;(of a coin) to determine which team will bat first. Two batsmen and eleven fielders then enter the field and play begins when a member of the fielding team, known as the&nbsp;<a href="https://en.wikipedia.org/wiki/Bowling_(cricket)" title="Bowling (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">bowler</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Delivery_(cricket)" title="Delivery (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">delivers</a>&nbsp;(i.e., bowls) the&nbsp;<a href="https://en.wikipedia.org/wiki/Cricket_ball" title="Cricket ball" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">ball</a>&nbsp;from one end of the pitch towards the wicket at the other end, which is guarded by one of the batsmen, known as the striker. In addition to the bowler, the fielding team includes the&nbsp;<a href="https://en.wikipedia.org/wiki/Wicket-keeper" title="Wicket-keeper" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">wicket-keeper</a>, a specialist who stands behind the striker''s wicket. The nine other fielders are tactically deployed around the field by their captain, usually in consultation with the bowler. The striker "takes guard" on a&nbsp;<a href="https://en.wikipedia.org/wiki/Crease_(cricket)" title="Crease (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">crease</a>&nbsp;drawn on the pitch four feet in front of the wicket. His role is to prevent the ball from hitting the stumps by using his&nbsp;<a href="https://en.wikipedia.org/wiki/Cricket_bat" title="Cricket bat" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">bat</a>&nbsp;and, simultaneously, to strike it well enough to score runs. The other batsman, known as the non-striker, waits at the opposite end of the pitch near the bowler. The bowler''s objectives are to prevent the scoring of runs and to&nbsp;<a href="https://en.wikipedia.org/wiki/Dismissal_(cricket)" title="Dismissal (cricket)" style="color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">dismiss</a>&nbsp;the batsman. A dismissed batsman, who is declared to be "out", must leave the field to be replaced by a team-mate. An over is a set of six deliveries bowled by the same bowler. The next over is bowled from the other end of the pitch by a different bowler.</p>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
